CREATE TABLE IF NOT EXISTS `program_studi` (
  `program_studi_id` VARCHAR(2) NOT NULL,
  `nama` VARCHAR(50) NULL,
  `jenjang` VARCHAR(50) NULL,
  `sort_order` INT NULL,
  `default_data` TINYINT(1) NULL DEFAULT 0,
  `waktu_buat` DATETIME NULL,
  `waktu_ubah` DATETIME NULL,
  `admin_buat` BIGINT NULL,
  `admin_ubah` BIGINT NULL,
  `ip_buat` VARCHAR(50) NULL,
  `ip_ubah` VARCHAR(50) NULL,
  `aktif` TINYINT(1) NULL DEFAULT 1,
  PRIMARY KEY (`program_studi_id`))
ENGINE = InnoDB;

